import * as actionTypes from './actionTypes'
export const addGame = (newGame) =>{
    return{
        type: actionTypes.ADD_GAME,
        payload: newGame
    }
}
export const deleteGame = (id) =>{
    return{
        type: actionTypes.DELETE_GAME,
        payload: id
    }
}
